doc/native/Call.html.body:
Call使用 Call 模块， WebView 可以主动触发原生 ViewController 的 call 方法。通过该模块，你可以实现当用户点按某个Web元素时，要求 ViewController 进行事件响应的需求。RequestParamsString methodName;
Object userInfo;
ResponseParams-ExampleJSMessage.newMessage("Native.Call", {
    methodName: "callMe",
    userInfo: {name: "Pony"}
}).call(null);

doc/native/Check.html.body:
Check使用 Check API 检查当前SDK版本以及当前SDK可用的模块。支持同步的方式获取返回结果。RequestParams-ResponseParamsString SDKVersion;
RESULT checkResult;

RESULT {
    (String)moduleName: (Int)moduleVersion;
}
Example// 同步调用
var syncResult = JSMessage.newMessage("Native.Check").call()
console.log(syncResult)

// 异步调用
JSMessage.newMessage("Native.Check").call(function(meta, result) {
    if (meta.error){ return console.error(error); }
    console.log(result.checkResult['Native.Check'])
})

doc/native/DataModel.html.body:
DataModelDataModel是原生应用与WebView进行数据交换的桥梁。原生应用可以通过 DataModel 模块，向 WebView 传递数据。

WebView 也可以通过 DataModel 模块，向 原生应用 传递数据。

RequestParamsOPT     opt;
String  dataKey;
Any     dataValue;

enum OPT {
    case "update"
    case "read"
}
ResponseParamsWhole dataModel maps;Example初始化数据WebView 在加载完成时，应该请求一次 DataModel 全量数据，以获取在网页未加载完成时的暂存数据。并把 JSDataModel 变量挂在window对象下, 否则数据变化触发的 JSDataModelDidChanged 方法会不生效window.JSDataModel = {}
function init() {
    JSMessage.newMessage("Native.DataModel").call(function(dataModel){
        window.JSDataModel = dataModel
        console.log(dataModel)
    })
}
传递数据原生应用使用以下方法，向 WebView 传递数据。self.webView.updateDataModel("date", dataValue: NSDate().description)
WebView 使用以下方法，向原生应用传递数据。JSMessage.newMessage("Native.DataModel", {
    opt: "update",
    dataKey: "word",
    dataValue: "Hello, World!"
}).call(null);
响应数据变化DataModel 中的数据变化时，JSDataModelDidChanged 函数会被调用，你可以通过定义该函数，响应数据变化。window.JSDataModelDidChanged(dataKey) {
    if (dataKey == "date") {
        // do something
    }
}

doc/native/FileManager.html.body:
FileManager使用 FileManager 操控沙箱中的任意文件你可以操控 Document / Caches / Tmp 目录中的任何文件，不受任何限制，但请注意以下要点。Document 该目录只能存放由用户主动生成的数据，不能存放缓存数据

Caches 该目录存放缓存数据

Tmp 该目录下的文件，会随时被清除

模块提供四个操作方法，写入、读取、检查、删除。read = 读取文件

update = 写入文件

delete = 删除文件

check = 检查文件是否存在

RequestParamsSUITE         suite;
OPT         opt;
String         filePath;
(String or Base64_String) fileContents;

enum SUITE {
    case "Document"
    case "Caches"
    case "Tmp"
}

enum OPT {
    case "read"
    case "update"
    case "delete"
    case "check"
}
ResponseParams(String or Base64_String) fileContents;
Example写入一个文件JSMessage.newMessage("Native.FileManager", {suite: "Caches", opt: "update", filePath: "test.txt", fileContents: "hello world"}).call(null);
读取一个文件JSMessage.newMessage("Native.FileManager", {suite: "Caches", opt: "read", filePath: "test.txt"}).call(function(meta, result){
    if (meta.error){ return console.error(error) }
    console.log(result.optSucceed, result.fileContents)
})

doc/native/HTTPRequest.html.body:
HTTPRequest使用 HTTPRequest 模块可以突破跨域限制，无须JSONP，直接获取任意HTTP数据。如果HTTP数据是 UTF-8 字符串，则直接返回 responseText，否则，返回 Base64 编码后的 String 至 responseData。你还可以添加自定义的 HTTP Header 到请求的头部。安全如果使用该 API，Native 会禁用任何自带的 Cookie 信息，以保证安全性。如果需要使用 Cookie，你需要自行将其添加至 Header 中，或者使用Web提供的Ajax方法。RequestParamsString             URL;
Base64_String     data;
Bool             showActivityIndicator;
Int                timeout;
Object             headers; 
ResponseParamsInt             statusCode;
String             responseText;
Base64_String     responseData;
Example// 获取一个GitHub的接口数据
JSMessage.newMessage("Native.HTTPRequest", {
    URL: "https://status.github.com/api.json",
    headers: {aKey: "aValue"}
}).call(function(meta, result) {
    if (meta.error){ return console.error(error); }
    console.log(result)
})

// 获取图片数据
JSMessage.newMessage("Native.HTTPRequest", {
    URL: "http://www.huanju.cn/s/v1206/HuanJu-LOGO-PNG.png"
}).call(function(meta, result){
    if (meta.error){ return console.error(error); }
})

doc/native/Notification.html.body:
Notification使用 Notification 可以跨 WebView 通讯，而 Notification 在 iOS 中实际上就是 NSNotification，在 Android 中实际上就是 Boardcast。一个通知可以分为两个角色，发送者、观察者。发送者，负责发送通知。观察者，负责响应通知。使用 Notification 模块除了可以响应通知以外，还可以接收到通知的额外信息。使用 Notification 模块也可以发送通知信息。RequestParamsOPT    opt;
String name;
String aPostObject;
Object aPostUserInfo;

enum OPT {
    case "create"
    case "delete"
    case "post"
}
ResponseParamsString object;
Object userInfo;
Example监听通知（添加观察者）监听应用退出后台以后，重新进入的事件。JSMessage.newMessage("Native.Notification", {
    name: "UIApplicationDidBecomeActiveNotification"
}).call(function () {
    //应用重新进入后，该代码块被调用。
});
发送通知（通知观察者）我们也可以主动发送一个通知JSMessage.newMessage("Native.Notification", {
    name: "Test",
    opt: "post",
    aPostObject: "This notification is post via WebView",     aPostUserInfo: {aKey: "aValue"}
}).call(null);
移除观察者如果不再需要监听相关事件，使用 delete 进行移除。
name 留空则表示，移除当前 web 页所有的监听者。
name 不留空则表示移除当前 web 页该 name  的所有监听者。JSMessage.newMessage("Native.Notification"{
    opt:"delete",
    name:""
}).call(null)

doc/native/OpenIntent.html.body:
OpenIntent使用 OpenIntent 打开某个应用，或者让应用决定应该如何响应 URL。需指定目标应用的 Package 名称，以及目标应用的 Activity 名称。RequestParamsString name;
String action;ResponseParams-Example例如，我需要打开微信应用，那么，应该这样调用JSMessage.newMessage("Native.OpenIntent", {
    name: "com.tencent.mm",
    action: "com.tencent.mm.ui.LauncherUI"
}).call(function(meta, result){
    if (meta.error){ return console.error(error); }
    document.write(result.succeed);
});
CanOpenIntent使用 CanOpenIntent 判断是否可以打开某个应用需指定目标应用的 Package 名称，以及目标应用的 Activity 名称。RequestParamsString name;
String action;ResponseParams-ExampleJSMessage.newMessage("Native.CanOpenIntent", {
    name: "com.tencent.mm",
    action: "com.tencent.mm.ui.LauncherUI"
}).call(function(meta, result){
    if (meta.error){
        document.write("Can't Open"); 
        return console.error(error); 
    }
    else {
        document.write("Can Open");
    }

});

doc/native/OpenURL.html.body:
OpenURL使用 OpenURL 打开某个应用，或者让应用决定应该如何响应 URL。安卓也可以使用该 API，SDK 会调用系统浏览器，打开该 URL，具体该URL由什么应用处理，则交由 OS 控制。RequestParamsString URL;
ResponseParams-Example例如，我需要打开微信应用，那么，应该调用 wechat://JSMessage.newMessage("Native.OpenURL", {
    URL: "wechat://"
}).call(null)
CanOpenURL使用 CanOpenURL 判断是否可以打开某个应用一个应用是否可以打开，取决于两点当前应用是否已经将目标应用添加到白名单（Info.plist）
目标应用是否已经安装
CanOpenURL 可以针对以上两点进行检测RequestParamsString URL;
ResponseParams-Example例如，需要打开微信应用，那么，应该检测 wechat://JSMessage.newMessage("Native.CanOpenURL", {
    URL: "wechat://"
}).call(function(meta, result){
    if (meta.error){
        document.write("Can't Open"); 
        return console.error(error); 
    }
    else {
        document.write("Can Open");
    }
});

doc/native/Pasteboard.html.body:
Pasteboard使用 Pasteboard 模块可以将文本内容暂存到系统剪贴板中，在需要的时候，用户可以粘贴该内容。RequestParamsOPT    opt;
