}).call(null)

doc/native/UserDefaults.html.body:
UserDefaultsUserDefaults 模块可以保存一些简单的数据，并持久化到闪存中。UserDefaults 和 Cookie 比较类似，不同的是， UserDefaults 并不会默认传输到网站， UserDefaults 相当于一个简单的 Key-Value 数据库。UserDefaults 可以创建多个仓库，不同仓库有不同的 Key-Value 数据。RequestParamsOPT        opt;
String     suite;
String     key;
Any     value;

enum OPT {
    case "create"
    case "update"
    case "read"
    case "delete"
}
ResponseParamsAny value;
Example保存一对 Key-Value 到仓库JSMessage.newMessage("Native.UserDefaults", {
    opt: "update",
    key: "test",
    value: "hello"
}).call(null)
读取一对 Key-ValueJSMessage.newMessage("Native.UserDefaults", {
    opt: "read",
    key: "test"
}).call(function(meta, result){
    if (meta.error){ return console.error(error); }
    console.log(result.value)
})

doc/ui/ActionSheet.html.body:
ActionSheet使用 ActionSheet 可以弹出一个包含多个选项的对话框，用户选择对应选项后会有回调。点击取消选项和点击蒙版区域触发相同的事件。RequestParamsString   title;
String[] buttonTitles;
Int      dangerButton;
String   cancelButton;
ResponseParamsInt buttonIndex; 
ExampleJSMessage.newMessage("UI.ActionSheet", {
    title: "请问，罗老板隐婚了多久？",
    buttonTitles: ["一年", "两年", "三年", "五年"],
    dangerButton: 3,
    cancelButton: "我选择死亡"
}).call(function(meta, result) {
    if (meta.error){ return console.error(error); }
    console.log(result.buttonIndex)
})

doc/ui/AlertView.html.body:
AlertView使用 AlertView 模块弹出一个原生的警告对话框，用户选择对应选项后会有回调。RequestParamsString      title;
String      message;
String[]    buttonTitles;
ResponseParamsInt buttonIndex;
ExampleJSMessage.newMessage("UI.AlertView", {
    title: "即将毁灭地球，请确认。",
    buttonTitles: ["马上毁灭", "稍后再试"]
}).call(function(meta, result) {
    console.log(result)
    if (result.buttonIndex == 0) {
        console.log("正在发射核弹...");
    }
    else {
        console.log("太迟了......");
    }
})

